import * as React from "react";
import { Typography, Select, Row,Col } from "antd";
import { useSelector } from "react-redux";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faClinicMedical, faHospital } from '@fortawesome/free-solid-svg-icons';


import { useCtx } from "one-ui-provider";
import { NV } from 'one-micro';

const { Text } = Typography;


export const HospitalDetails = () => {
  const { resolver } = useCtx();
  const calledto = useSelector(state => state.calledto);
  const dnis = (calledto && calledto.length>0 && calledto[0]) || {};

  let contentrender = null;
  let type = (dnis && dnis.typeName) ? dnis.typeName: '';
    let typeicon;

    if(type.toUpperCase() === "CLINIC"){
      type= "Clinic";
      typeicon= (
        <FontAwesomeIcon icon={faClinicMedical} size='2x' />
      )
    } else {
      type= "CallCenter";
      typeicon= (
        <FontAwesomeIcon icon={faHospital} size='2x' />
      )
    }

   if(dnis.typeName){
    contentrender=(

   <div style={{
     padding: '15px',
   }}>

      <Row>
        <Col span={12}>
        <Text>
            {typeicon} <span style={{fontSize:"18px"}}>{type}</span>
        </Text>
          <NV name='Name' value={dnis.name ? dnis.name : "NA"} />
          <NV name='Address' value={dnis.address ? dnis.address : "NA"} />
          <NV name='Phone' value={dnis.csn ? dnis.csn : "NA"} />
        </Col>
        <Col span={1}>
        </Col>
        <Col span={8}>
        <NV name='Hours of Operation' value={''} />
          <NV name='Mon-Fri' value={[(dnis && dnis.open_Hours && dnis.open_Hours.monday_open) ? dnis && dnis.open_Hours && dnis.open_Hours.monday_open : "NA",(dnis && dnis.open_Hours && dnis.open_Hours.monday_close) ? dnis && dnis.open_Hours && dnis.open_Hours.monday_close : "NA"]} />
          <NV name='Saturday' value={[(dnis && dnis.open_Hours && dnis.open_Hours.saturday_open) ? dnis && dnis.open_Hours && dnis.open_Hours.saturday_open : "NA",(dnis && dnis.open_Hours && dnis.open_Hours.saturday_close) ? dnis && dnis.open_Hours && dnis.open_Hours.saturday_close : "NA"]} />
          <NV name='Sunday' value={[(dnis && dnis.open_Hours && dnis.open_Hours.sunday_open) ? dnis && dnis.open_Hours && dnis.open_Hours.sunday_open : "NA",(dnis && dnis.open_Hours && dnis.open_Hours.sunday_close) ? dnis && dnis.open_Hours && dnis.open_Hours.sunday_close : "NA"]} />
        </Col>
      </Row>

      </div>

    )
     } else{
      contentrender =<div></div>
     }
  // } else{
  //   contentrender =<div
  //   style={{
  //     textAlign: "center",
  //     position: "relative",
  //     fontSize:"22px"
  //   }}
  //   >
  //     <br/>
  //     <Icon type="phone"  rotate= {90}  style={{fontSize:"130px"}}/>
  //     <br />

  //       {dnis.phone}
  //   </div>
  // }

  return (
    <div>
 {contentrender}
    </div>

  );
};
